import React from 'react'
import { Navbar, Footer } from '../components'


const DefaultLayout: React.FC = ({ children }): React.ReactElement => {
	return (
		<>
			<Navbar />
			<div className="container">
				{children}
			</div>
			<Footer />
		</>
	)
}


export default DefaultLayout
